# Mainframe Backdoor Script:						#
#  On z/OS users can submit jobs (or JCL) via FTP (using site file=JES) #
#  jobs can also execute programs in OMVS (or UNIX) by calling          #
#  BPXBATCH and pasing the shell commands to run. This script comes     #
#  with a copy NETCAT compiled for OMVS. It uploads the binary,         #
#  switches the FTP server in to JES mode and uploads a random JCL file #
#  which executes a netcat listener. It then connects to the listener   #
#                                                                       #
# Requirements: Python, z/OS FTP Server username/password and the right #
#               access rights.						#
# Created by: Soldier of Fortran (@mainframed767)               	#
# Usage: Given an IP address, username and password this script will  	#
# connect to an FTP server, upload a binary, convert to JES mode 	#
# and submit a job. The job executes the binary which listens for	#
# incoming connections which the script connects to. Giving you a UNIX	#
# shell. 								#
#                                                               	#
# Copyright GPL 2013                                             	#
